import React from "react";
import "./Header.css";
import { NavLink } from "react-router-dom";
import { TAGS } from "../../data";

export default function Header() {
  return (
    <nav>
      <ul>
        {TAGS.map((tag) => (
          <li key={tag}>
            <NavLink
              to={`/${tag}`}
              className="header-navlink"
              activeClassName="active"
            >
              {tag}
            </NavLink>
          </li>
        ))}
      </ul>
    </nav>
  );
}
